import React from 'react';
import styled from 'styled-components';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

const StyledIcon = styled.div`
  display: inline-flex;
  align-items: center;
  justify-content: center;
  
  svg {
    font-size: 1.2rem;
  }
`;

export const SearchIcon = () => (
  <StyledIcon>
    <BsSearch />
  </StyledIcon>
);

export const ChartIcon = () => (
  <StyledIcon>
    <BsBarChart />
  </StyledIcon>
);

export const GearIcon = () => (
  <StyledIcon>
    <BsGear />
  </StyledIcon>
);

export const FileIcon = () => (
  <StyledIcon>
    <BsFileText />
  </StyledIcon>
);

export const FilterIcon = () => (
  <StyledIcon>
    <BsFilter />
  </StyledIcon>
);

export const SaveIcon = () => (
  <StyledIcon>
    <BsSave />
  </StyledIcon>
);

export const TrashIcon = () => (
  <StyledIcon>
    <BsTrash />
  </StyledIcon>
);
